// App.js
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import FindUserForgotPassword from './components/FindUserForgotPassword';
import SentOtpForgotPassword from './components/SentOtpForgotPassword';
import ResetPassword from './components/ResetPassword';
import Home from './components/Home';
import Login from './components/Login';
import Signup from './components/Signup';

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/signup" element={<Signup />} />
                <Route path="/forgot-password/find-user" element={<FindUserForgotPassword />} />
                <Route path="/forgot-password/send-otp" element={<SentOtpForgotPassword />} />
                <Route path="/forgot-password/reset-password" element={<ResetPassword />} />
            </Routes>
        </Router>
    );
}

export default App;
